import React from "react";
import styled from 'styled-components';

const Wrapper = styled.div`
    width: 868px;
    font-size: 14px;
    letter-spacing: 0;
    color: #202d3d;
    margin: 30px auto 0;
`

export const AuthNote = () => {
    return <Wrapper>* функционал который появится в ближайшее время</Wrapper>
}
